import React from 'react';
import {FriendListItem} from './FriendsListItem'
import styles from './friends.modules.css'
console.log(styles)

export const FriendList=({friends})=> {
 return(  <ul className = {styles.friendList}>
        {friends.map(friend => (
            <FriendListItem
                key = {friend.id}
                {...friend}/>))}
    </ul>
)
}
